import './master.css';
import React from 'react';

const ResultContainer = (props) => {
  let retval = [];
  let len = props.children.length;

  for(let i = 0; i < len; i += 3){
    let cols = [];
    for(let j = i; j < (i+3 < props.childrne.length ? i+3 : props ); j++){
      cols.push(props.children[i]);
    }
    retval.push(
      <div className="row">
        {cols}
      </div>
    );
  }

  return (
    {retval}
  );
};

export default ResultContainer;
